import react from "react";
import Home from "./pages/Home/Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import DetailsScreen from "./pages/DetailsScreen/DetailsScreen";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <div>
              <Home />
            </div>
          }
        />
         <Route
          path="/details"
          element={
            <div>
              <DetailsScreen />
            </div>
          }
        />
      </Routes>
    </Router>
  );
};

export default App;
